/* eslint-disable no-unused-vars */
/* eslint-disable no-console */
import React from 'react';
import { connect } from 'react-redux';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Copyright from '../../components/CopyRight';
import background from '../../Assets/bg-login.jpg';
import history from '../../components/History';

const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: `url(${background})`,
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    alignItems: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: '250px',
  },
  Copyright: {
    paddingTop: '600px',
    textAlign: 'center',
  },
}));

const ShowList = () => {
  const classes = useStyles();

  const handleChooseAccount = () => {
    console.log('Handling');
    window.assign('https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?access_type=offline&scope=https%3A%2F%2Fwww.googleapis.com%2Fauth%2Fcontacts.readonly&response_type=code&client_id=6808591183-4msj8nlg44stk09uqr8hjrt5itcmks9n.apps.googleusercontent.com&redirect_uri=http%3A%2F%2Flocalhost%3A4000&flowName=GeneralOAuthFlow');
  };

  return (
    <Grid container component="main" className={classes.root}>
      <Grid item xs={12} sm={6} md={6} className={classes.image}>
        <div style={{
          position: 'absolute', top: '45%', left: '10%', fontSize: '40px',
        }}
        >
          Choose Account to view Contacts
        </div>
      </Grid>
      <Grid item xs={12} sm={6} md={6} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="outlined" color="primary" onClick={handleChooseAccount}>
            Choose account
          </Button>
          <br />
          <Copyright />
        </div>
      </Grid>
    </Grid>
  );
};

const mapStateToProps = (state) => ({ profile: state.profile });

export default connect(mapStateToProps)(ShowList);
